import React from "react";
import Table from "react-bootstrap/Table";

import Square from "./Square";

function Board(props) {
  const { rows, columns, robotPosition, targetPosition } = props;
  console.log(rows);
  console.log(columns);

  return (
    <>
      <Table bordered size="lg" style={{ width: "500px", height: "500px" }}>
        <tbody>
          {rows.map((row, i) => {
            return (
              <tr key={i}>
                {columns.map((column, j) => {
                  return (
                    <Square
                      key={j}
                      rowPosition={i}
                      columnPosition={j}
                      robotPosition={robotPosition}
                      targetPosition={targetPosition}
                    ></Square>
                  );
                })}
              </tr>
            );
          })}
        </tbody>
      </Table>
    </>
  );
}

export default Board;
